import axios from 'axios';
import * as React from 'react'

import EmployeeService from '../services/EmployeeService';
export default class Employee extends React.Component<any, any> {
    readonly url="http://localhost:8090/api/Employee/GetEmployees";
    constructor(props: any) {
        super(props);
        this.state = {
            isLoading: false,
            employees: [],
        }; 
    };
    
    componentDidMount() {
        const token = localStorage.getItem('access_token');
        this.setState({ isLoading: true });
        axios.get(this.url,{
            headers:{
                'Content-Type': 'application/json',
                'Authorization': `Bearer ${token?.replace(/["]+/g, '')}`,
            }
        })
        .then(res => {
          const employees = res.data;
          console.log(employees);
          this.setState({ employees ,isLoading:false});
        })
        .catch(error=>console.log(error.message)); 
    }
    handleUpdate = (id: any) => {
        //event.preventDefault();
    alert(id)
    };
  
    render() {
        const { employees, isLoading } = this.state;
        if (isLoading) {
            return <p>Loading ...</p>;
        }
        return (
            <div>
               <table className='table table-bordered'>
                   <thead className='text-lg-center'>
                       <th>Employess</th>
                   </thead>
                   <tbody>
                       {
                           this.state.employees.map(emp=>
                            <tr>
                            <td key={emp.employeeId}>{emp.employeeId}</td>
                            <td>{emp.employeeName}</td>
                            <td>{emp.companyName}</td>
                            <td>{emp.month}</td>
                            <td>
                                <input type='button' className='btn-primary' value='Update' onClick={this.handleUpdate(emp.employeeId)} />
                                <input type='button' className='btn-danger' value='Delete'/>
                            </td>
                            </tr>
                            )
                       }
                   </tbody>
               </table>
            </div>
        )
    }

}
